INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_address`, `field_phone`, `field_facebook`, `field_twitter`, `field_aboutText`, `field_workType`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('2', '2', 'en_us', 'Homepage', 'Welcome to Denizen.dev!', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Denizen.dev will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', NULL, NULL, NULL, NULL, NULL, NULL, '2014-04-29 18:07:09', '2014-04-29 18:07:09', '47a3969b-8ab1-4be3-bc56-8a983d01ae92');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_address`, `field_phone`, `field_facebook`, `field_twitter`, `field_aboutText`, `field_workType`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('3', '3', 'en_us', 'We just installed Craft!', NULL, '<p>Craft is the CMS that’s powering Denizen.dev. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p><!--pagebreak--><p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p><p>Craft: a nice alternative to Word, if you’re making a website.</p>', NULL, NULL, NULL, NULL, NULL, NULL, '2014-04-29 18:07:09', '2014-04-29 18:07:09', '4f05a7cc-2f6c-45aa-9ecd-b27b2e489c16');
