INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_address`, `field_phone`, `field_facebook`, `field_twitter`, `field_aboutText`, `field_workType`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('22', '22', 'en_us', 'Velocity Vinsetta', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2014-04-29 23:15:54', '2014-05-15 12:23:57', '77558ef3-b7ea-4163-a3b0-62ae8ca4d317');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_address`, `field_phone`, `field_facebook`, `field_twitter`, `field_aboutText`, `field_workType`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('23', '23', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Welcome to the dark side&hellip; where Denizens flourish.</p><p>We are monsters at TV marketing and experts in the black art of persuasion. We woo. We wow. We win awards. And our client list is a who’s who of the top TV networks.</p><p>But we know promo magic doesn’t happen by magic. It’s built by hand and we get our hands dirty every step of the way -- with rock-solid concepts, crisp copy, killer graphics, and drum-tight editing.</p><p>Concept is king here. Before any script gets written or any edit suite fired up, we unearth the most compelling ideas. This makes our episodics feel like launch campaigns and our sizzle reels feel like theatrical trailers. There is no box big enough to contain our creative thought-process.</p><p>Some think the best ideas come out of the blue. We believe the best ones come out of the dark. That\'s why we live there.</p><p>We are Denizen. Come join us on the dark side.</p>', NULL, '2014-04-30 01:21:30', '2014-05-14 23:50:34', 'dba3d5bd-0b41-4f78-a1ee-8cfb8eee9e40');
